{"nbformat":4,"nbformat_minor":0,"metadata":{"colab":{"provenance":[],"authorship_tag":"ABX9TyNdCMZ8SDeLKXchRta9HYR3"},"kernelspec":{"name":"python3","display_name":"Python 3"},"language_info":{"name":"python"}},"cells":[{"cell_type":"code","execution_count":1,"metadata":{"colab":{"base_uri":"https://localhost:8080/","height":1000},"id":"GJV7IGHJelsD","executionInfo":{"status":"ok","timestamp":1736483459593,"user_tz":-330,"elapsed":7840,"user":{"displayName":"Tanmoy Chatterjee","userId":"11299406191758908036"}},"outputId":"1aaa404e-cca1-4538-ddb2-d93b8e76884a"},"outputs":[{"output_type":"stream","name":"stdout","text":["1. Activation Functions and their Derivatives\n","\n","\n","\n","Sigmoid\n","\n","\n","ReLU\n","\n","\n","Softmax\n","\n","\n","Maxout\n","\n"]},{"output_type":"display_data","data":{"text/plain":["<Figure size 1200x1000 with 8 Axes>"],"image/png":"\n"},"metadata":{}},{"output_type":"stream","name":"stdout","text":["\n","\n","2. Regularization Techniques\n","\n","\n","\n","Regularization techniques help avoid overfitting in deep learning models. Common methods include:\n","1. L1 Regularization: Adds a penalty proportional to the absolute value of weights.\n","2. L2 Regularization: Adds a penalty proportional to the square of weights.\n","3. Dropout: Randomly drops neurons during training to prevent co-adaptation.\n","4. Batch Normalization: Normalizes activations to reduce internal covariate shift.\n","5. Data Augmentation: Expands the training dataset by applying transformations to inputs.\n","6. Early Stopping: Stops training when validation performance starts to degrade.\n","\n","\n","\n","3. Prove ReLU Non-linearity and Map Curves\n","\n","\n"]},{"output_type":"display_data","data":{"text/plain":["<Figure size 1200x1200 with 5 Axes>"],"image/png":"\n"},"metadata":{}}],"source":["import numpy as np\n","import matplotlib.pyplot as plt\n","\n","print(\"1. Activation Functions and their Derivatives\\n\\n\")\n","# Sigmoid Function\n","def sigmoid(x):\n","    return 1 / (1 + np.exp(-x))\n","\n","def sigmoid_derivative(x):\n","    s = sigmoid(x)\n","    return s * (1 - s)\n","\n","# ReLU Function\n","def relu(x):\n","    return np.maximum(0, x)\n","\n","def relu_derivative(x):\n","    return np.where(x > 0, 1, 0)\n","\n","# Softmax Function\n","def softmax(x):\n","    exp_x = np.exp(x - np.max(x))  # For numerical stability\n","    return exp_x / np.sum(exp_x, axis=0)\n","\n","def softmax_derivative(x):\n","    s = softmax(x)\n","    return s * (1 - s)  # Simplified derivative\n","\n","# Maxout Function\n","def maxout(x, W, b):\n","    z = np.dot(W, x) + b[:, np.newaxis]\n","    return np.max(z, axis=0), z\n","\n","def maxout_derivative(z):\n","    max_indices = np.argmax(z, axis=0)\n","    grad = np.zeros_like(z)\n","    grad[max_indices, np.arange(z.shape[1])] = 1\n","    return grad\n","\n","# Plot Activation Functions\n","x = np.linspace(-5, 5, 500)\n","\n","print(\"\\nSigmoid\\n\")\n","plt.figure(figsize=(12, 10))\n","plt.subplot(4, 2, 1)\n","plt.plot(x, sigmoid(x), label=\"Sigmoid\")\n","plt.title(\"Sigmoid Activation\")\n","plt.grid()\n","\n","plt.subplot(4, 2, 2)\n","plt.plot(x, sigmoid_derivative(x), label=\"Sigmoid Derivative\", color=\"red\")\n","plt.title(\"Sigmoid Derivative\")\n","plt.grid()\n","\n","print(\"\\nReLU\\n\")\n","plt.subplot(4, 2, 3)\n","plt.plot(x, relu(x), label=\"ReLU\")\n","plt.title(\"ReLU Activation\")\n","plt.grid()\n","\n","plt.subplot(4, 2, 4)\n","plt.plot(x, relu_derivative(x), label=\"ReLU Derivative\", color=\"red\")\n","plt.title(\"ReLU Derivative\")\n","plt.grid()\n","\n","print(\"\\nSoftmax\\n\")\n","plt.subplot(4, 2, 5)\n","softmax_values = softmax(np.array([x, -x]))\n","plt.plot(x, softmax_values[0], label=\"Softmax\")\n","plt.title(\"Softmax Activation\")\n","plt.grid()\n","\n","plt.subplot(4, 2, 6)\n","plt.plot(x, softmax_derivative(x), label=\"Softmax Derivative\", color=\"red\")\n","plt.title(\"Softmax Derivative\")\n","plt.grid()\n","\n","print(\"\\nMaxout\\n\")\n","k = 3\n","W = np.array([[1], [0.5], [-0.5]])\n","b = np.array([0, 1, -1])\n","maxout_values, z = maxout(x[np.newaxis, :], W, b)\n","plt.subplot(4, 2, 7)\n","plt.plot(x, maxout_values, label=\"Maxout\")\n","plt.title(\"Maxout Activation\")\n","plt.grid()\n","\n","plt.subplot(4, 2, 8)\n","maxout_grad = maxout_derivative(z)\n","plt.plot(x, maxout_grad[0], label=\"Maxout Derivative\", color=\"red\")\n","plt.title(\"Maxout Derivative\")\n","plt.grid()\n","\n","plt.tight_layout()\n","plt.show()\n","\n","print(\"\\n\\n2. Regularization Techniques\\n\\n\")\n","regularization_text = \"\"\"\n","Regularization techniques help avoid overfitting in deep learning models. Common methods include:\n","1. L1 Regularization: Adds a penalty proportional to the absolute value of weights.\n","2. L2 Regularization: Adds a penalty proportional to the square of weights.\n","3. Dropout: Randomly drops neurons during training to prevent co-adaptation.\n","4. Batch Normalization: Normalizes activations to reduce internal covariate shift.\n","5. Data Augmentation: Expands the training dataset by applying transformations to inputs.\n","6. Early Stopping: Stops training when validation performance starts to degrade.\n","\"\"\"\n","print(regularization_text)\n","\n","print(\"\\n\\n3. Prove ReLU Non-linearity and Map Curves\\n\\n\")\n","curves = [\n","    lambda x: x**2 + x - 2,\n","    lambda x: x**3 + x**2 + x - 2,\n","    lambda x: x**5 + x**2,\n","    lambda x: x**3 - x - 2,\n","    lambda x: x**6 + x**4 + x - 2\n","]\n","\n","plt.figure(figsize=(12, 12))\n","for i, curve in enumerate(curves):\n","    y = curve(x)\n","    y_relu = relu(y)\n","    plt.subplot(3, 2, i + 1)\n","    plt.plot(x, y, label=\"Original Curve\")\n","    plt.plot(x, y_relu, label=\"ReLU Curve\", linestyle=\"--\")\n","    plt.title(f\"Curve {i+1}\")\n","    plt.legend()\n","    plt.grid()\n","\n","plt.tight_layout()\n","plt.show()\n"]}]}